import React, {Component} from 'react';
import NavbarDefault from './components/navbar/navbar_default';
import logo from './public/logo/logo_white.svg';

import listReactFiles from 'list-react-files'


class Portfolio extends Component {
  constructor(props) {
    super(props);
    listReactFiles('./public/photos/').then(files => console.log(files));
  }

  getPhotos() {
    var folder = "public/photos";
    var photos = []
    document.ajax({
      url : folder,
      success: function (data) {
        $(data).find("a").attr("href", function (i, val) {
          if( val.match(/\.(jpe?g|png|gif)$/) ) {
            photos.push(folder + val);
          }
        });
      }
    });
    console.log(photos)
  }

  render() {
    return(
      <div className="container">
        <NavbarDefault />
        {listReactFiles('./public/photos').then(files => console.log(files))}
      </div>
    );
  }
}

export default Portfolio;
